import React from 'react';
class Input extends React.Component {
 

  
  onClick = () => {
    console.log('Input was clicked!');
  }

  onMouseEnter = () => {
    console.log('Mouse entered the input!');
  }

  render() {
    return (
      <input
        placeholder='текст'
        onClick={this.onMouseEnter}
        onMouseEnter={this.onClick}
      />
    );
  }
}
export default Input
